import React from 'react';
import './Navbar.scss';

const Navbar = (props) => {
    return(
        <nav className='main-nav'>
           <ul className="navbar-list">
               <li className="navbar-list-item focus-nav-icon">Get Started</li>
               <li className="navbar-list-item" onClick={props.toggle()}>about</li>
               <li className="navbar-list-item" onClick={props.toggle('Help')}>help</li>
           </ul>
        </nav>
    )
}

export default Navbar
